import certificate1 from "../assets/images/certificates/certificate1.png";
import certificate2 from "../assets/images/certificates/certificate2.png";

const certificateImages = [
  {
    id: "1",
    alt: "Image1",
    src: certificate1,
  },
  {
    id: "2",
    alt: "Image2",
    src: certificate2,
  },
];

export default certificateImages;
